import "./App.css";

function App() {
  return (
    <React.Fragment className="App">
      <nav>navigation bar</nav>
      <header>Hero Section</header>
      <main>
        <section>Highlights</section>
        <section>testimonials</section>
        <section>about</section>
      </main>
      <footer>
        <nav>footer nav</nav>
      </footer>
    </React.Fragment>
  );
}

export default App;
